<?phpdeclare(strict_types=1);namespace App\Military\Entity\Units;use Doctrine\ORM\Mapping as ORM;/** * @ORM\Embeddable */class Officials{    /**     * @var string     * @ORM\Column(type="string", nullable=true)     */    private $unit = null;    /**     * @var string     * @ORM\Column(type="string", nullable=true)     */    private $rank = null;    /**     * @var string     * @ORM\Column(type="string", nullable=true)     */    private $fio = null;    /**     * @var string     * @ORM\Column(type="string", nullable=true)     */    private $telephone = null;    public function __construct(        string $unit,        string $rank,        string $fio,        string $telephone    )    {        $this->unit = $unit;        $this->rank = $rank;        $this->fio = $fio;        $this->telephone = $telephone;    }    /**     * @return string     */    public function getUnit(): string    {        return $this->unit;    }    /**     * @return string     */    public function getRank(): string    {        return $this->rank;    }    /**     * @return string     */    public function getFio()    {        return $this->fio;    }    /**     * @return string     */    public function getTelephone()    {        return $this->telephone;    }    public function isEqualTo(self $official): bool    {        return            $this->getUnit() === $official->getUnit() &&            $this->getRank() === $official->getRank() &&            $this->getFio() === $official->getFio() &&            $this->getTelephone() === $official->getTelephone();    }}